USE gallery_db;

CREATE TABLE users (
	id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
    external_id varchar(10), 
	first_name VARCHAR(50),
    last_name VARCHAR(50),
	username VARCHAR(40),
    password VARCHAR(40),
    photo varchar(36),
    registration_date date,
    email VARCHAR(50),
    movile VARCHAR(20),
    birth date,
    gender INT,
    country VARCHAR(50),
    city VARCHAR(50),
    postal_code, active VARCHAR(14),
    active INT,
	INDEX cart_index(id)
, 0);

